    render() {
        return (
            <form>
                <Field name="title"
                        name = "description"
                    type="text"
                    component={renderField}
                    label="Username" />
            </form>
        );
    }
}

export default reduxForm({
    form: 'streamCreate'
})(StreamCreate);
